import React, { useState } from 'react';
import PropTypes from 'prop-types';
import {
  AppBar,
  Box,
  Toolbar,
  IconButton,
  Typography,
  Badge,
  MenuItem,
  Menu,
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  Divider,
  Drawer,
  createTheme,
  ThemeProvider,
  useTheme,
  useMediaQuery,
} from '@mui/material';

import {
  DateRange as DateRangeIcon,
  Home as HomeIcon,
  Menu as MenuIcon,
  AccountCircle,
  Mail as MailIcon,
  Groups3 as Groups3Icon,
  Notifications as NotificationsIcon,
  MoreVert as MoreIcon,
} from '@mui/icons-material';
import { deepPurple } from '@mui/material/colors';

const drawerWidth = 240;

const theme = createTheme({
  palette: {
    primary: { main: deepPurple[900], textIcon: deepPurple[50] },
    secondary: { main: deepPurple[400] },
    black: { main: deepPurple.A700, textIcon: deepPurple.A100 },
  },
});

const DrawerContent = ({ navItems, onClose }) => (
  <Box onClick={onClose} sx={{ textAlign: 'left', backgroundColor: theme.palette.black.main }}>
    <Typography variant="h4" sx={{ my: 2, color: theme.palette.black.textIcon }}>
      Nzan's Absen
    </Typography>
    <Divider />
    <List>
      {navItems.map((item) => (
        <ListItem key={item.path} disablePadding>
          <ListItemButton sx={{ textAlign: 'left' }}>
            <ListItemIcon sx={{ color: theme.palette.black.textIcon }}>{item.icon}</ListItemIcon>
            <ListItemText disableTypography primary={item.text} />
          </ListItemButton>
        </ListItem>
      ))}
    </List>
  </Box>
);

DrawerContent.propTypes = {
  navItems: PropTypes.array.isRequired,
  onClose: PropTypes.func.isRequired,
};

export function NavbarDash({ window, session }) {
  const thema = useTheme();
  const isMobile = useMediaQuery(thema.breakpoints.down('sm'));

  const navItems = session?.role === 'admin'
    ? [
        { text: 'Home', icon: <HomeIcon />, path: '/dashboard' },
        { text: 'Laporan Absen', icon: <Groups3Icon />, path: '/dashboard/absen' },
        { text: 'Calendar', icon: <DateRangeIcon />, path: '/dashboard/calendar' },
        { text: 'Tambah User', icon: <DateRangeIcon />, path: '/dashboard/tambah-user' },
      ]
    : [
        { text: 'Home', icon: <HomeIcon />, path: '/dashboard' },
        { text: 'Absen', icon: <Groups3Icon />, path: '/dashboard/absen' },
        { text: 'Calendar', icon: <DateRangeIcon />, path: '/dashboard/calendar' },
      ];

  const [mobileOpen, setMobileOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);

  const handleDrawerToggle = () => setMobileOpen(!mobileOpen);
  const handleProfileMenuOpen = (event) => setAnchorEl(event.currentTarget);
  const handleMenuClose = () => setAnchorEl(null);
  const handleMobileMenuOpen = (event) => setMobileMoreAnchorEl(event.currentTarget);
  const handleMobileMenuClose = () => setMobileMoreAnchorEl(null);

  const isMenuOpen = Boolean(anchorEl);
  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

  const container = window !== undefined ? () => window().document.body : undefined;

  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      id="primary-search-account-menu"
      open={isMenuOpen}
      onClose={handleMenuClose}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
    </Menu>
  );

  const renderMobileMenu = (
    <Menu
      anchorEl={mobileMoreAnchorEl}
      id="primary-search-account-menu-mobile"
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
    >
      <MenuItem>
        <IconButton size="large">
          <Badge badgeContent={4} color="error">
            <MailIcon />
          </Badge>
        </IconButton>
        <p>Messages</p>
      </MenuItem>
      <MenuItem>
        <IconButton size="large">
          <Badge badgeContent={17} color="error">
            <NotificationsIcon />
          </Badge>
        </IconButton>
        <p>Notifications</p>
      </MenuItem>
      <MenuItem onClick={handleProfileMenuOpen}>
        <IconButton size="large">
          <AccountCircle />
        </IconButton>
        <p>Profile</p>
      </MenuItem>
    </Menu>
  );

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ display: 'flex' }}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              onClick={handleDrawerToggle}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" sx={{ flexGrow: 1 }}>
              Nzans Absensi
            </Typography>
            <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
              <IconButton size="large">
                <Badge badgeContent={4} color="error">
                  <MailIcon />
                </Badge>
              </IconButton>
              <IconButton size="large">
                <Badge badgeContent={17} color="error">
                  <NotificationsIcon />
                </Badge>
              </IconButton>
              <IconButton size="large" onClick={handleProfileMenuOpen}>
                <AccountCircle />
              </IconButton>
            </Box>
            <Box sx={{ display: { xs: 'flex', md: 'none' } }}>
              <IconButton size="large" onClick={handleMobileMenuOpen}>
                <MoreIcon />
              </IconButton>
            </Box>
          </Toolbar>
        </AppBar>
        <nav>
          <Drawer
            container={container}
            variant={isMobile ? 'temporary' : 'permanent'}
            open={isMobile ? mobileOpen : true}
            onClose={isMobile ? handleDrawerToggle : undefined}
            ModalProps={{ keepMounted: true }}
            sx={{
              '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
            }}
          >
            <DrawerContent navItems={navItems} onClose={handleDrawerToggle} />
          </Drawer>
        </nav>
        {renderMobileMenu}
        {renderMenu}
      </Box>
    </ThemeProvider>
  );
}

NavbarDash.propTypes = {
  window: PropTypes.func,
  session: PropTypes.object,
};
